import styled from "styled-components";

export const StyledProjects = styled.div`
  height: 80vh;
  border: solid white;

  h1 {
    display: flex;
    justify-content: center;
    color: #fefefe;
    font-size: 130px;
  }

  .container {
    height: 500px;
    width: 350px;
  }
`;
